import React from "react";
import { AppBar, Toolbar, makeStyles } from "@material-ui/core";

const useStyles = makeStyles({
    normal: {
        maxHeight:"100px",
    }
});


const Navbar = () =>{
    return(
        <div>
            <AppBar position="static">
                <Toolbar>
                    Examples
                </Toolbar>
            </AppBar>
        </div>
    )
}
export default Navbar;
